import React from "react";
import "./Brunch.css";

const Brunch = ({ text }) => {
  return (
    <div className="brunch about_text" id="brunch">
      <h1 className="about_title">{text.brunch_title}</h1>
      <div className="brunch_about item_text">{text.brunch_about}</div>
      <div className="social_media_brunch">
        <a
          href="https://www.instagram.com/houseoflightgrilbars/"
          target="_blank"
          rel="noopener noreferrer"
        >
          <i className="fab fa-instagram"></i>
        </a>
        <a
          href="https://www.facebook.com/houseoflightgrilbars/"
          target="_blank"
          rel="noopener noreferrer"
        >
          <i className="fab fa-facebook"></i>
        </a>
      </div>
    </div>
  );
};

export default Brunch;
